import React from 'react';

function Intro(props) {
    return (
        <div className='main'>
            <div className="overlay"></div>
            <video src={`${process.env.PUBLIC_URL}/images/brand/fxlm_intro.mp4`} autoPlay loop muted/>
        </div>
    );
}

export default Intro;
